import React, { useState, useEffect } from 'react';

function ShowAppointment() {

  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    // Assuming data.json is in the public folder
    fetch('data.json')
      .then((res) => res.json())
      .then((result) => {
        setDoctors(result);
        console.log(result)
      })
  }, []);

  return (
    <div className='assign'>
      <u>
        <p className='home-logout'>
          <a href='/SignInPage'>logout</a>
        </p>
      </u>
      <u>
        <p className='home-logout'>
          <a href='/'>Home</a>
        </p>
      </u>
      <h1 className='header2'>Appointments</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Speciality</th>
            <th>Day</th>
            <th>Start Time</th>
            <th>End Time</th>
          </tr>
        </thead>
        <tbody>
          {doctors.map((doctor, index) => {
            // Use an if statement to conditionally render appointments with the name "osama"
            if (doctor.Name.toLowerCase() === 'osama') {
              return (
                <tr key={doctors.id}>
                  <td>{doctor.Name}</td>
                  <td>{doctor.speciality}</td>
                  <td>{doctor.Day1}</td>
                  <td>{doctor.Start1}</td>
                  <td>{doctor.end1}</td>
                </tr>
              );
            }
          })}
        </tbody>
      </table>
      <button>
        <a href='/ChooseDoc'>Back</a>
      </button>
    </div>
  );
}

export default ShowAppointment;
